import React from 'react';
import resume from '../../files/Resume.jpg';
import pdf from '../../files/Resume.pdf';


function Hobbies() {
    return (
        <div className='hobbies'>
            <h1></h1>
            <a href={pdf}>Click here for PDF version</a>

            <img src={resume}/>

        </div>
    )
}

export default Hobbies
